import React from 'react';
import { LinkContainer } from 'react-router-bootstrap';
import { Navbar, Nav, Container, NavDropdown, Form, FormControl, Button } from 'react-bootstrap';
import { useDispatch, useSelector } from 'react-redux';
import { logout } from '../actions/userActions';
import SearchBox from './SearchBox';
import '../styles/Header.css'; // Make sure you adjust CSS for dark theme

const Header = () => {
  const dispatch = useDispatch();
  const userLogin = useSelector((state) => state.userLogin);
  const { userInfo } = userLogin;

  const logoutHandler = () => {
    dispatch(logout());
  };

  return (
    <header>
      <Navbar bg="dark" variant="dark" expand="lg" className="py-2" collapseOnSelect>
        <Container fluid>
          <LinkContainer to="/">
            <Navbar.Brand className="fw-bold fs-4 text-warning">ProShop</Navbar.Brand>
          </LinkContainer>

          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            {/* SearchBox centered like Amazon */}
            <div className="mx-auto w-50">
              <SearchBox />
            </div>

            {/* Right side Nav links */}
            <Nav className="ms-auto align-items-center">
              {/* Orders Link */}
              {userInfo && (
                <LinkContainer to="/profile">
                  <Nav.Link className="text-white">
                    <div style={{ fontSize: '0.8rem' }}>Hello, {userInfo.name}</div>
                    <div style={{ fontWeight: 'bold' }}>Account & Lists</div>
                  </Nav.Link>
                </LinkContainer>
              )}
              {!userInfo && (
                <LinkContainer to="/login">
                  <Nav.Link className="text-white">
                    <div style={{ fontSize: '0.8rem' }}>Hello, Sign in</div>
                    <div style={{ fontWeight: 'bold' }}>Account & Lists</div>
                  </Nav.Link>
                </LinkContainer>
              )}

              {/* Orders */}
              {userInfo && (
                <LinkContainer to="/orders">
                  <Nav.Link className="text-white">
                    <div style={{ fontSize: '0.8rem' }}>Returns</div>
                    <div style={{ fontWeight: 'bold' }}>& Orders</div>
                  </Nav.Link>
                </LinkContainer>
              )}

              {/* Cart */}
              <LinkContainer to="/cart">
                <Nav.Link className="text-white">
                  <i className="fas fa-shopping-cart"></i> Cart
                </Nav.Link>
              </LinkContainer>

              {/* Admin Menu */}
              {userInfo && userInfo.isAdmin && (
                <NavDropdown title="Admin" id="adminmenu" className="text-white">
                  <LinkContainer to="/admin/userlist">
                    <NavDropdown.Item>Users</NavDropdown.Item>
                  </LinkContainer>
                  <LinkContainer to="/admin/productlist">
                    <NavDropdown.Item>Products</NavDropdown.Item>
                  </LinkContainer>
                  <LinkContainer to="/admin/orderlist">
                    <NavDropdown.Item>Orders</NavDropdown.Item>
                  </LinkContainer>
                  <NavDropdown.Item onClick={logoutHandler}>Logout</NavDropdown.Item>
                </NavDropdown>
              )}
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </header>
  );
};

export default Header;
